import React from "react";
import Header from "../../Components/header";
import "./style.css";

export default function Order() {
  const findOrderBanner =
    "https://cdn-fsly.yottaa.net/5d669b394f1bbf7cb77826ae/www.bathandbodyworks.com/v~4b.216/on/demandware.static/-/Sites-BathAndBodyWorks-Library/default/dw290ae529/images/banners/order-status-banner-asset_d.svg?yocs=s_";
  return (
    <div className="order_page">
      <Header />

      <img style={{ marginTop: "60px" }} src={findOrderBanner} alt="" />
      <div className="order_wrapper">
        <span style={{ fontSize: "30px" }}>Order Tracking</span>
        <div className="order_line"></div>
        <div className="order_box">
          <div className="input_field">
            <span className="input_label">Credit Card Number *</span>
            <input
              type="text"
              className="payment_input_field"
              placeholder="4111 1111 1111 1111"
            />
          </div>
        </div>
      </div>
    </div>
  );
}
